import './null.css'
import './App.css';
import React from 'react';
import {Link, Routes, Route} from 'react-router-dom'

import {Header} from './header/header'
import Footer from './footer/footer';
import Main from './main/main';

const App=()=> {
  return (
    <div className="App">
      <Header/>
    <Routes>
      <Route path=''></Route>
      <Main className='Main'/>
    </Routes>

     <Footer/>
    </div>
  );
}

export default App;
